(19, 'Avoid 5 issues that were discovered in online Quran classes?', 'avoid-5-issues-that-were-discovered-in-online-quran-classes', 'uploads/blogs/images/1638907122_Quran-5.jpg', '<p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Avoid 5 issues that were discovered in online Quran\r\nclasses<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">What are the most important reasons your children\r\nshould stay clear of in <a href=\"https://quranteacherlive.com/\" target=\"_blank\">online Quran classes</a>? While there are many\r\nbenefits for online Quran classes There are certain issues that children\r\nencounter during online Quran classes, due to children\'s inability to focus in\r\nhow to learn their Quran lessons. If we do to prevent these problems, we\r\nwill get amazing results and a 100% guarantee.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">5 Problems and Solutions<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">The most essential elements that must be present in\r\nlive instruction is the student\'s concentration and dedication. There are\r\nmany distractions or activities that divert the pupil\'s focus from focus on the\r\nQuran lesson. These are the issues that teachers and students confront\r\nduring online Quran classes However, you don\'t have to be worried! We\'ll\r\nalso offer solutions to these issues with the help of parents and children. Let\'s\r\ntake a look!<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">1. Poor web-connection<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">A poor internet connection can cause frequent\r\ndisconnects throughout Live Quran classes, that could result in interruptions. The\r\ninterruption can distract students to the Quran lessons online. Moreover, they\r\nmay also be unable to comprehend important aspects of the lecture. As a\r\nresult, students are likely to get bored with these kinds of online Quran\r\nclasses.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Solution<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Parents should ensure their children have an\r\ninternet connection with a good speed to ensure a smooth and efficient communication\r\nduring Live on-line Quran classes.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">2. Have fun playing with toys in class<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Children are fascinated by playing with their peers\r\nand enjoy playing with their toys. Therefore they have their toys close\r\nwhile taking classes online Quran classes. However, this isn\'t the right\r\nthing to do because, when students are listening to Quran lessons their\r\nattention may be diverted with their gadgets. Therefore they aren\'t able\r\nto concentrate on their Quran lessons properly online.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Solution<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Make sure that your children\'s toys from the area\r\nin which they are taking on online Quran classes. You should also make\r\nsure that they aren\'t placing their toys near them during the time that they\r\nare listening to what the Quran teacher is talking what they are saying about\r\nwhat they learned in the Quran lesson.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">3. Eating Stuff<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Certain children are foodies and like to eat. Students\r\nare often eating or chewing diverse foods such as food items, fries, snack gum,\r\netc. However, it\'s not recommended to do this as eating food can divert\r\nthe attention of students and prevents them from learning Arabic letters with\r\nprecision. The sounds of Arabic Tajweed and letters are crucial; hence\r\nit\'s not advisable to eat meals while studying the Quran on the internet.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Solution<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Request their children to take a snack and eat\r\ntheir fill prior to starting Live Quran class. Also, avoid anything edible\r\nin the class.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">4. Get out of the way<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Children love running from one location to another. This\r\nis why they will leave the place they are to attend the internet-based Quran\r\nclass. This means that they might miss their crucial lecture in accordance\r\nwith the timetable.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Solution<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Parents must be attentive to their children. They\'re\r\nnot finished with their classes. <span style=\"background:lightgreen\">Before\r\nregistering to the <a href=\"https://www.onlinequrantuition.co.uk/\" target=\"_blank\">online Quran Academy</a> parents must make sure that their\r\nchildren sit in front of the computer when they are online in Quran classes.</span><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">5. Watching TV<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">It\'s also a problem that children are constantly\r\nwatching television during Quran class. The TV screen distracts students\'\r\nfocus and frustrates the Quran teacher through background noise.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Solution<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Parents must shut off the television while your\r\nchildren are taking online classes. Additionally, they shouldn\'t put the\r\ntelevision in the room where the children take classes in live Quran classes.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Wrap Up<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size:10.5pt;font-family:\"Arial\",sans-serif;\r\nmso-fareast-font-family:\"Times New Roman\";color:#414141;letter-spacing:.75pt;\r\nmso-fareast-language:EN-GB\">Our aim is to draw attention to certain issues that\r\narise during the live-streamed Quran classes, so that they are not a problem by\r\ninvolving parents. If you can control your concerns, we will assure that\r\nyour children will master Quran quickly and effortlessly.<o:p></o:p></span></p>', NULL, 'Avoid 5 issues that were discovered in online Quran classes?', NULL, 'Quran Memorisation, Quran Teachers, Tajweed Course, Online Quran Teachers', '2021-11-02 18:16:40', '2021-12-08 02:58:42', 'showed'),
(20, 'How long does it take to learn one page of the Quran?', 'how-long-does-it-take-to-learn-one-page-of-the-quran', 'uploads/blogs/images/1638907241_Quran-6.jpg', '<h1 align=\"center\" style=\"text-align:center;mso-list:l0 level1 lfo1\"><span lang=\"EN-US\">How long does it take to learn\r\none page of the Quran?<o:p></o:p></span></h1><h2 style=\"line-height:150%;mso-list:l0 level2 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext\">1.1<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">       \r\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext\">Learning Quran:<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext\">The only way to paradise and salvation is\r\nthrough the Holy Quran. The Noble Quran was revealed to Muhammad (SAW), the\r\nLast Messenger, for the benefit of the whole Ummah. Return to it and apply it\r\nin your daily life to reach the degree of high admiration in the eyes of the\r\nSupreme deity.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 150%; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Muslims, including men and women,\r\nare required to <a href=\"https://www.onlinequrantuition.co.uk/online-madrasa-uk\" target=\"_blank\">learn the Quran</a>. It is our religious duty to learn the Quran\r\nthoroughly and correctly. However, some fortunate individuals accept the\r\nchallenge of memorizing the entire Quran and earning the title of Hafiz. Being\r\na hifz-e-Quran is a prominent and honored title, and learning Quran is, in some\r\nways, the literal purpose of every Muslim\'s life. </span><span lang=\"EN-US\" style=\"font-size: 10.5pt; line-height: 150%; color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><h2><!--[if !supportLists]--><span lang=\"EN-US\">1.2<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">       \r\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Memorizing\r\none page:<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"line-height: 150%; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">However, memorizing the Holy Quran\r\nmay be challenging for someone who does not speak Arabic. Many people try to\r\nlearn to let go of their ideas in preparation for the challenge of\r\nmemorization. Some people, on the other hand, are dedicated to their goal, put\r\nforth the effort, and learn the entire Quran.</span><span lang=\"EN-US\" style=\"mso-bidi-font-family:\"Times New Roman\";color:windowtext\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"line-height: 150%; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">For everyone interested in learning\r\nthe Quran, one concern that usually arises is how long it will take to memorize\r\none page, one verse, or even one Rukuh (section on of a para). According to\r\npopular belief, learning one page of the Quran takes around <b>25-30</b> minutes. However, it is\r\ncontingent on several circumstances, including the language barrier, age, and\r\nmemory. Everyone has their own set of criteria.</span><span lang=\"EN-US\" style=\"line-height: 150%; color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:\r\n12.0pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">It\r\nis dependent on the individual and their age. Also, if the individual speaks\r\nArabic and is familiar with the alphabet. Taking the time to memorize each\r\nverse of each surah you read daily. To make it easier, write it down on a piece\r\nof paper after each reading of the Holy Quran. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:\r\n12.0pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">You\'re\r\ngoing to your <a href=\"https://quranteacherlive.com/\" target=\"_blank\">Quran classes</a>. Attending surah explanations might also be\r\nbeneficial in the long run.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:\r\n12.0pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">Learning\r\none page in the start of your journey of memorizing the Quran looks good\r\nbecause It works, telling yourself, \"I\'m only going to do a little bit</span><span lang=\"EN-US\"> </span><span lang=\"EN-US\" style=\"mso-bidi-font-size:12.0pt;\r\nline-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:\r\n12.0pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">It\r\nworks because telling yourself \"I\'m only going to do a little bit\"\r\n(after all, it\'s only 25 minutes) is one of the easiest methods to mislead\r\nyourself out of procrastination. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:\r\n12.0pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">You\r\nalso don\'t have to complete the entire page; any of these ways can be tailored\r\nto your specific abilities. I believe it is ideal to not select an amount to\r\nstudy at first while using this strategy, but rather to just start learning.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:\r\n12.0pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">It\r\nall depends on your recollection and Arabic language skills... Also, your\r\ncommitment... and the time you put in... The Qur’an includes roughly</span><span lang=\"EN-US\" style=\"mso-bidi-font-family:\"Times New Roman\";color:windowtext\">\r\n6200 verses, and if you start learning 10 verses a day, you\'ll be done in no\r\ntime (almost one page) It should take 620 days, or just over 2 years... It will\r\ntake around 1240 days or 3.3 years if you study 5 verses per day</span><span lang=\"EN-US\" style=\"font-size: 11.5pt; line-height: 150%; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">.</span><span lang=\"EN-US\" style=\"font-size: 11.5pt; line-height: 150%; color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><h2 style=\"line-height:150%;mso-list:l0 level2 lfo1\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"mso-fareast-font-family:\"Times New Roman\";mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext\">1.3<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \"Times New Roman\";\">       \r\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext\">Concluding Remarks:<o:p></o:p></span></h2><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"font-size:\r\n11.5pt;line-height:150%;mso-bidi-font-family:\"Times New Roman\";color:windowtext\">It\r\ndepends on the person - his/her effort, the time out in, the fluency of\r\nrecital, whether he/she is proficient in tajweed and whether memorization is\r\nwith good tajweed, and then of course, whether the person is 100% focused on\r\nQuran or is distracted by other </span><span lang=\"EN-US\" style=\"mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext\">commitments.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext;letter-spacing:-.1pt\">It works because one\r\nof the best ways to trick yourself out of procrastination is to tell yourself\r\n\"I\'m only going to do a little bit\", after all it\'s only 10mins.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"line-height:150%\"><span lang=\"EN-US\" style=\"mso-bidi-font-family:\r\n\"Times New Roman\";color:windowtext;letter-spacing:-.1pt\">You don\'t have to do a\r\nwhole page either, all of these different methods can be adapted to suit your ability.\r\nWith this method, in the beginning, I think its best not to specify an amount\r\nto learn but rather just an amount of time that you want to dedicate as this\r\nhelps build confidence, and also I find the more you specify the more likely\r\nyou are to procrastinate if you have this problem and Allah knows best.<o:p></o:p></span></p>', NULL, 'How long does it take to learn one page of the Quran?', 'The only way to paradise and salvation is through the Holy Quran. The Noble Quran was revealed to Muhammad (SAW), the Last Messenger, for the benefit of the whole Ummah. Return to it and apply it in your daily life to reach the degree of high admiration in the eyes of the Supreme deity', 'Quran Memorisation, Quran Teachers, Tajweed Course, Online Quran Teachers', '2021-11-11 19:04:29', '2021-12-08 03:00:41', 'showed'),
(21, 'How do I teach my 5-year-old to read the Quran?', 'how-do-i-teach-my-5-year-old-to-read-the-quran', 'uploads/blogs/images/1636714802_kid-g37d908235_640.jpg', '<h1 align=\"center\" style=\"margin-left:36.0pt;text-align:center;text-indent:-18.0pt;\r\nmso-list:l1 level1 lfo2\"><span lang=\"EN-US\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></span><!--[endif]--><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">How do\r\nI teach my 5-year-old to read the Quran?<o:p></o:p></span></h1><p class=\"MsoNormal\"><span lang=\"EN-US\">All Muslims have a responsibility to teach\r\nthe Quran to youngsters. Because they are more skilled, youngsters can learn\r\nthe Quran far more easily than adults. In truth, studies have demonstrated that\r\nyoungsters have an easier time to</span><span style=\"color: rgb(98, 98, 98); font-family: Montserrat, Helvetica, Arial, serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: 0.14px; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span>&nbsp;</span><a href=\"https://quranteacherlive.com/\" target=\"_blank\">lea</a></span><span lang=\"EN-US\"><a href=\"https://quranteacherlive.com/\" target=\"_blank\">rning Quran</a>, particularly when it comes to\r\nlanguage.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">As a result, we must all make an effort to\r\nteach the Quran to our children so that they might benefit from it until they\r\nreach adulthood. But where do we begin in <a href=\"https://www.onlinequrantuition.co.uk/tajweed-classes\" target=\"_blank\">teaching the Qur\'an</a> to our children?\r\nWell, here\'s the thing: they can memorize the Qur\'an and stay linked to it from\r\na young age.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Every parent\'s dream is\r\nto raise children who love the Quran and Sunnah and pray five times a day.\r\nAfter all, we want to raise good, Salah-loving children who understand and\r\nadore Islam. Many parents are torn between teaching their children the Five\r\nPillars of Islam, providing delight for them during Ramadan and Hajj,\r\npurchasing the greatest Islamic toys and books, and beginning the Arabic\r\nAlphabet. There are so many to consider!</span><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"mso-bidi-font-size:12.0pt;\r\nline-height:107%;font-family:Montserrat;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\">There is no one-size-fits-all approach\r\nto teaching the Quran to small children. Some families feel it beneficial to\r\nsend their children to a formal institute with a knowledgeable instructor who\r\ncan devote 100% of their attention to their child, while others find it beneficial\r\nto simply teach their children at home.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"font-family: Montserrat; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">When children are young, between the\r\nages of three and six, they require pleasant learning methods. Look for a\r\nteacher who knows what you\'re going through. Take a peek at their schedule as\r\nwell. Don\'t overcrowd it. If things aren\'t working out, you can come up with\r\nyour inventive solutions.</span><span lang=\"EN-US\" style=\"font-family: Montserrat; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"font-family: Montserrat; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">You can begin teaching tiny Duas and Surahs to a\r\nchild. Then slowly once they develop the interest take the next step of making\r\nthem teach Ayahs.</span><span lang=\"EN-US\" style=\"font-family: Montserrat; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 18pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span lang=\"EN-US\" style=\"color:black;mso-color-alt:windowtext\">You might\r\nbe wondering how to teach your child the Quran once you\'ve decided to do so.\r\nHere\'s a step-by-step guide to how I did it.</span><span lang=\"EN-US\" style=\"font-family: Montserrat; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><h2><!--[if !supportLists]--><span lang=\"EN-US\">1.1<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Assign your child to a Qaida<o:p></o:p></span></h2><p class=\"MsoNormal\"><span lang=\"EN-US\">It is critical to first identify the\r\ncorrect type of Qaida. You don\'t want to end up having to change your books later.\r\nYour child will become irritated as a result of this. So, first and foremost,\r\nlocate a decent book. Color-coded Tajweed parts are essential for your child\'s\r\nsuccess, so keep an eye out for these<b>.</b></span><b><span lang=\"EN-US\" style=\"font-size:14.0pt;\r\nmso-bidi-font-size:13.0pt;line-height:107%;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-theme-font:major-fareast;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:major-bidi;color:black;mso-themecolor:text1\"><o:p></o:p></span></b></p><h2><!--[if !supportLists]--><span lang=\"EN-US\">1.2<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Recognize the learning approach<o:p></o:p></span></h2><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\">Your child learns best when he is actively\r\ninvolved in his surroundings. Observing things, watching faces, and responding\r\nto sounds are all examples of this. Listening to noises, making sounds, and\r\nsinging are all activities that can be done with your hands.<o:p></o:p></span></p>', NULL, 'How do I teach my 5-year-old to read the Quran?', 'All Muslims have a responsibility to teach the Quran to youngsters. Because they are more skilled, youngsters can learn the Quran far more easily than adults. In truth, studies have demonstrated that youngsters have an easier time learning, particularly when it comes to language.', 'Quran Memorisation, Quran Teachers, Tajweed Course, Online Quran Teachers', '2021-11-12 18:00:03', '2021-11-12 18:00:03', 'showed'),
(22, 'Does memorizing Quran improve memory?', 'does-memorizing-quran-improve-memory', 'uploads/blogs/images/1637237587_quran-g963ce0293_640.jpg', '<h2 align=\"center\" style=\"margin-left:46.8pt;text-align:center;text-indent:0cm;\r\nmso-list:none\"><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Does memorizing Quran\r\nimprove memory?<o:p></o:p></span></h2><p class=\"MsoNormal\"><span lang=\"EN-US\">&nbsp;</span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Muslims may regard\r\nQuran memorization as a testament of faith, and the higher the level of\r\nmemorization, the larger the psychological boost to their religion, which\r\nincludes feelings of satisfaction, contentment, and optimism.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color: rgb(25, 25, 25); letter-spacing: 0.1pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">In Islam, the benefits of memorizing the Quran come in the\r\nform of divine bounties, but the activity can also improve IQ and brain health.<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color: rgb(25, 25, 25); letter-spacing: 0.1pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">According to Dr. Haneen Jarrar, a child psychologist at\r\nCamali Clinic, memorizing a big amount of text at a young age improves a\r\nperson\'s working memory and learning ability. The brain works similarly to a muscle\r\nin that the more it is used, the stronger it becomes. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">In Islam, <a href=\"https://www.onlinequrantuition.co.uk/quran-hifz-program\" target=\"_blank\">memorizing Quran</a> and reading\r\nit daily is a highly praised act. Memorization of the Quran is a procedure that\r\nimproves a person\'s overall aptitude by developing many cognitive talents.\r\nBecause the brain is the most basic and important organ for human development\r\nand skill acquisition, memorizing the Quran improves not just memorization but\r\nalso knowledge retention, concentration span, consistency, working under\r\npressure, and overcoming distractions. As a result, memorizing the Quran gives\r\nyou the ability to quickly pick up other difficult skills and abilities.<o:p></o:p></span></p><h1 style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">What\r\nthe Quran itself Says:<o:p></o:p></span></h1><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">According to\r\nstudies, memorizing the Quran has psychological benefits. You will be a\r\nwell-rounded, happy person, and it will benefit your memory, learning speed,\r\nand working memory.”<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color:#292929;letter-spacing:-.05pt\">The\r\nHoly Quran has numerous advantages. It\'s a Book of Light, and heavenly light is\r\na healing force. The Qur\'an has around 89 verses that discuss the book\'s\r\npurpose, goals, virtues, and blessings. Some of these passages emphasize the\r\nQuran\'s ability to heal:<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"text-align:center\"><span lang=\"EN-US\" style=\"letter-spacing:-.05pt\">“<i>O mankind! Surely, there has come to you a\r\n(heart penetrating) counsel from your Master and a cure for all those\r\n(diseases) which are (hidden) in the chests. And it is guidance and mercy for\r\nthose who believe” (</i></span><i><span lang=\"EN-US\" style=\"color:#292929;\r\nletter-spacing:-.05pt\">Yūnus, 10:57)<o:p></o:p></span></i></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Memorizing challenges the brain and trains\r\nit to recall information. In the first definitive study to show that honing\r\nintellectual skills can bolster the mind in the same way that physical exercise\r\nprotects and strengthens the body, ten sessions of exercises to boost reasoning\r\nskills, memory, and mental processing speed staved off mental decline in\r\nmiddle-aged and elderly people.<o:p></o:p></span></p><h1 style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">Results Shown in Studies and Research:<o:p></o:p></span></h1><p class=\"MsoNormal\"><span lang=\"EN-US\" style=\"color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">The Alzheimer\'s Association conducted research to see if\r\nthere was a link between religiosity (memorizing the Quran) and good memory.\r\nThe study\'s findings demonstrate that the Quran has an impact on memory\r\nstrength in two ways: religiosity and spirituality, and mental stimulation.\r\nThose who memorized the Quran have stronger memories than those who did not,\r\nand their chances of developing memory difficulties and disorders are lower.</span><span lang=\"EN-US\" style=\"color: windowtext; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Muslim scholars have debated and evaluated\r\nthe <a href=\"https://quranteacherlive.com/\" target=\"_blank\">Quran teaching</a> for centuries. Similarly, several researchers have\r\naddressed the intellectual benefits of memorizing the Quran, particularly in\r\nthe alternative world. They scientifically demonstrate how memorizing the Quran\r\ncan improve an individual\'s cognitive and general abilities.</span><b><span lang=\"EN-US\" style=\"font-size:16.0pt;\r\nline-height:107%;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-theme-font:\r\nmajor-fareast;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:major-bidi\"><o:p></o:p></span></b></p><h1 style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:l0 level1 lfo2\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">General Conclusion<o:p></o:p></span></h1><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\"><span lang=\"EN-US\">Memorization of the Quran is a technique\r\nthat develops numerous cognitive skills and improves an individual\'s overall\r\naptitude. Because the brain is the most basic and important organ for human\r\ndevelopment and skill acquisition, memorizing the Quran improves not just\r\nmemorization but also knowledge retention, concentration span, consistency, and\r\noperating under pressure. As a result, <a href=\"https://quranteacherlive.com/\" target=\"_blank\">memorizing Quran</a> gives you the\r\nability to quickly pick up other difficult skills and abilities.<o:p></o:p></span></p>', NULL, 'Does memorizing Quran improve memory?', 'Muslims may regard Quran memorization as a testament of faith, and the higher the level of memorization, the larger the psychological boost to their religion, which includes feelings of satisfaction, contentment, and optimism.', 'Quran Memorisation, Quran Teachers, Tajweed Course, Online Quran Teachers', '2021-11-18 19:13:07', '2021-11-18 19:13:07', 'showed');
