INSERT INTO `faqs` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1, 'Are the Quran lessons one to one?', 'Children are often too shy to put their hand up in large class rooms - especially if they\'re struggling.  One to one tutoring helps students on an individual level. It provides an equal opportunity for all the students to ask teachers about their learning quarries. It is a much more efficient way to impart the learning of Quran.', '2020-10-12 05:26:29', '2020-12-07 19:53:42'),
(2, 'Are your Quran teachers Qualified?', 'Our teachers are not only selected for their qualifications and knowledge, but also for their encouragement in teaching, Noorani Qaida, Tajweed-ul-Quran and Quran memorization (Hifz)', '2020-10-12 05:27:23', '2020-12-07 19:58:22'),
(3, 'How do online Quran lessons work?', 'Our online Quran session is equipped with all the top edge facilities such as interactive whiteboard and screen sharing. Such modern tools are designed to give students and teachers a more near to life and interactive way.', '2020-12-07 19:09:53', '2020-12-07 19:38:40'),
(4, 'Why is online Quran tutoring important?', 'Online Quran tuition is cost effective, saves time and gives kids the chance to learn Quran online at their own pace in a way that matches their learning style', '2020-12-07 19:41:30', '2021-04-01 18:08:02'),
(5, 'Which textbooks are needed for online Quran teaching?', 'All our Quran lessons are digital and present in a pdf format. You don\'t need to buy any books Instead, the teacher will send the lesson to every student free of cost.', '2021-06-26 18:15:24', '2021-06-26 18:15:24');
