INSERT INTO `testimonials` (`id`, `name`, `review`, `rating`, `status`, `created_at`, `updated_at`, `review_date`) VALUES
(7, 'Imran Hussain', 'I have had a great experience working with a Online Quran Tuition, they are punctual,respectful and very friendly!', '5', 1, '2020-12-05 18:22:55', '2020-12-07 22:22:18', '2018-10-01 07:00:00'),
(8, 'Mirza Ali', 'Highly Recommended website to learn Quran', '5', 1, '2020-12-05 18:27:26', '2020-12-07 22:22:56', '2018-10-03 07:00:00'),
(9, 'Haseeb Mahmood', 'Prompt, efficient and helpful support. Always willing to take the time to answer a question', '5', 1, '2020-12-05 19:16:58', '2020-12-07 22:23:43', '2018-10-03 07:00:00'),
(10, 'Billal Aziz', 'The teacher is very polite and caring. The course help me to improve my tajweed.', '5', 1, '2020-12-05 19:26:44', '2020-12-07 22:24:35', '2018-10-05 07:00:00'),
(11, 'Rubeena Sheikh', 'Excellent place to learn how to read quran with tajweed. My teacher is very good, with excellent communications skills and very knowledgeable.\r\n\r\nI would definitely recommend to anyone looking to learn how to recite the quran.', '5', 1, '2020-12-05 19:28:38', '2021-03-15 17:32:33', '2018-10-06 07:00:00'),
(12, 'Naeema Akbarali', 'Very happy with the one to one attention given by the teacher to my so with Quran teaching.', '5', 1, '2020-12-05 20:02:47', '2020-12-07 22:25:55', '2018-10-06 07:00:00'),
(13, 'Sayed Zeko', 'Really happy with their teacher Tasnim. They\'ve been fantastic and kids have made good progress. The academy response very quickly to all enquiries. The children have learnt good tajweed and the teacher is the best by far.', '5', 1, '2020-12-05 20:07:49', '2020-12-07 22:57:27', '2018-10-07 07:00:00'),
(14, 'Sadia H', 'Great school for kids to learn Quran. Masha Allah my kids are Doing Great ever since they started , And Their Teachers are Very Kind, Respectful, And Loving.', '5', 1, '2020-12-05 20:09:27', '2020-12-07 22:58:08', '2018-10-07 07:00:00'),
