(83, 'Aisha Salam', 'The best decision we made signing up with Online Quran Tuition! All 3 of my children started a couple of months ago and the progress is unbelievable MashaAllah. The Quran teacher is very kind and patient. My 8-year-old twins who look forward to their class daily MashaAllah. And my teenager is pleased with how quickly he\'s picked up the speed of recitation with correct Tajweed, after a few years of not having a tutor. I highly recommend them for Online Quran Tuition.', '5', 1, '2020-12-10 14:32:23', '2020-12-10 14:32:23', '2019-03-23 07:00:00'),
(84, 'Muhammad Faisal', 'Good teaching program. We have enrolled our 5 year old son for 2 classes per week.\r\n\r\nThe teacher is very good and patient. The program is flexible too to suit our time zone and we are able to make changes to the class times as we need especially when there are weeks when we need to do more classes than planned.\r\n\r\nThe 3 free classes at the start also helped us to get a feel for the program and ensure that it\'ll work for our son before signing up.\r\n\r\nThe program coordinator has also been very helpful in being flexible and accommodating our requests.\r\n\r\nWe think the program works well for our son because of the 1:1 classes. We have several Quran class options in our home city where they run a Madarassah type learning environment, i.e. 20 students in a class. We wanted a 1:1 learning experience.\r\n\r\nAlso, another advantage is the 30 minute class duration. This is very helpful as we find that a 5 year old can only focus for that long before getting distracted/tired.\r\n\r\nA lot of the classes here in our hometown are 1 hour long which we find is way too much.\r\n\r\nThe most important thing for us was that the Quran learning experience should be an enjoyable experience for our son and not a chore or something that is forced.\r\n\r\nOverall, we are very satisfied with the program.', '5', 1, '2020-12-10 14:34:22', '2020-12-10 14:34:22', '2019-03-24 07:00:00'),
