(108, 'Aisha Noor', 'the teachers are very kind and teach the students with patience\r\nthe teachers are very kind.', '5', 1, '2020-12-11 16:22:24', '2020-12-11 16:22:24', '2019-05-11 07:00:00'),
(109, 'Muhammad Faisal', 'We’re very happy that we found Online Quran Class. Very convenient. Really appreciate you all. Jazakallah', '5', 1, '2020-12-11 16:23:03', '2020-12-11 16:23:03', '2019-05-13 07:00:00'),
(110, 'Shiza Noor', 'The competition went really well. We felt really excited having made it to the top ten and were really surprised at the excitement of our family and loved ones all wishing us well and success', '5', 1, '2020-12-11 16:23:56', '2020-12-11 16:23:56', '2019-05-14 07:00:00'),
(111, 'Sabir', 'The Online Quran Tuition to me is the best online Quran education network I could find. I\'m learning so much and the teachers and their support are so helpful and they make everything so much convenient and easy for you.', '5', 1, '2020-12-11 16:25:15', '2020-12-11 16:25:15', '2019-05-16 07:00:00'),
(112, 'Riaz Hussain', 'I am so glad for being a part from this great Online Quran Tuition, it is a big pleasure for being apart of this great and repectable team, who do their best in their job, and above everything appreciate the value of time', '5', 1, '2020-12-11 16:26:49', '2020-12-11 16:26:49', '2019-05-18 07:00:00'),
(113, 'Zainab', 'MashaAllah!! It\'s very difficult to find so professional and worthy online Quran Tution. The teacher Masha Allah is extremely polite and punctual. Never missed a class and my kids are very comfortable learning with her. Also, they have made a good progress just in a months time Alhumdullilah!!\r\nI highly recommend...', '5', 1, '2020-12-11 16:28:34', '2020-12-11 16:28:34', '2019-05-19 07:00:00'),
(114, 'Saiqa', 'Very good structured lessons with fluent English speaking teachers who have the correct recipe to keep the children enthused during the lesson and keep them motivated after the lesson.\r\nI highly recommend this online platform, it suits my sons timetable and he speaks highly of his Teacher.', '5', 1, '2020-12-11 16:29:26', '2020-12-11 16:29:26', '2019-05-20 07:00:00'),
(115, 'Junaid', 'Very reliable administrator who ensures that everything is okay.\r\nThe teachers are very professional and friendly.\r\nPersonally, it is more practical than going to the mosque and learning.', '5', 1, '2020-12-11 16:30:14', '2020-12-11 16:30:14', '2019-05-22 07:00:00'),
(116, 'Rana', 'Classes are paced based on your progress and level of understanding. Admin and teachers are supportive, and want you to succeed. Maa shaa Allah', '5', 1, '2020-12-11 16:30:54', '2020-12-11 16:30:54', '2019-05-22 07:00:00'),
(117, 'Ishaque Ata', 'Amazing service! I\'m 28 and started learning tajweed for the first time and the teacher is patient and great. working well with my schedule and pace.\r\nHighly recommend!', '5', 1, '2020-12-11 16:31:35', '2020-12-11 16:31:35', '2019-05-25 07:00:00'),
(118, 'Aisha', 'I really like the online class for my children. Our teacher is very patient and firm with my children, which makes the children take him serious and learn.', '5', 1, '2020-12-11 16:32:15', '2020-12-11 16:32:15', '2019-05-27 07:00:00'),
(119, 'Mariyam', 'Kids have been with onlinequrantuition for a few months now. When my daughter first started with brother Hossam she hardly knew how to read with tajweed but since then she came a long way and she is almost fluent in reading Quran with tajweed. Hossam is a good teacher who is patient and has good communication skills. Both my kids like having lessons with him. We are happy that we found onlinequrantuition, the whole process was simple and I would recommend the company to anyone who is interested in having online classes with native speakers of the Arabic language.', '5', 1, '2020-12-11 16:33:36', '2020-12-11 16:33:36', '2019-06-11 07:00:00'),
(120, 'Fabiya', 'The Online Quran Tution is extremely professional and the staff are incredibly kind. The lessons are excellent and clear and easy to set up for an amazing price. I would definitely recommend this course.', '5', 1, '2020-12-11 16:34:43', '2020-12-11 16:34:43', '2019-06-15 07:00:00'),
(121, 'Shahid', 'Excellent teachers and customer service. Very professional and easy to communicate with staff:) I am very happy to finally find a good online program for my kids. My kids teachers are very patient and encouraging:)', '5', 1, '2020-12-11 16:35:27', '2020-12-11 16:35:27', '2019-06-15 07:00:00'),
(122, 'Khalid', 'SalM allaykoum.\r\nThey are really amazing. I recommend it\r\nMy daughter enjoy taking her class and she is actually learning a lot from her teacher.', '5', 1, '2020-12-11 16:36:21', '2020-12-11 16:36:21', '2019-06-18 07:00:00'),
(123, 'Shan', 'I love the program my son now can read Quran I’m satisfied', '5', 1, '2020-12-11 16:37:22', '2020-12-11 16:37:22', '2019-06-21 07:00:00'),
(124, 'Parnia', 'Alhamdullilah so far so good. I am satisfied with their honest and prompt service. Tutor Sister Amira is always on time and knowledgeable in teaching Quran with tajweed.', '5', 1, '2020-12-11 16:38:16', '2020-12-11 16:38:16', '2019-06-25 07:00:00'),
(125, 'Saman', 'My teacher is excellent, she\'s so kind! I have improved my reading and memorization and pronunciation with her. It\'s only twice a week for half an hour and I truly learn a lot! May Allah reward them.', '5', 1, '2020-12-11 16:38:58', '2020-12-11 16:38:58', '2019-06-29 07:00:00'),
(126, 'Fatima', 'What an amazing people abd I love their teaching style and they are very helpful to my my child and the people I connected to them as well. I wished if knew them before but still not to late and my child is improving her Quran reading, tawjeed and hadeeth. I can’t thank them all enough but I ASK ALMIGHTY TO REWARD THEM', '5', 1, '2020-12-11 16:39:56', '2020-12-11 16:39:56', '2019-07-02 07:00:00'),
(127, 'Ahmad', 'Ola is a very good teacher, she is very patient and very kind. I have noticed my daughter improving in tajweed and her recitation.', '5', 1, '2020-12-11 16:40:38', '2020-12-11 16:40:38', '2019-07-05 07:00:00'),
(128, 'Kamran', 'I highly recommend Mrs. Doaa at The Online Quran Tution as she is the most qualified, hardworking, native Arabic, tajweed, and quran teacher I have met for English speaking students. I have taken quran courses locally and online and there is usually a gap in teaching non-native Arabic students Arabic and tajweed accurately. I didn\'t always understand the rules behind tajweed so I didn\'t always pronounce words clearly; however, I can say with confidence that I understand tajweed now better than before to the articulation point of every letter and much more because of her as she\'s very detailed with tajweed rules and quran pronunciation.\r\n\r\nShe explains where your strengths and weaknesses are so that you can improve. For example, I struggled with pronouncing light lam and heavy ra. She has a lot of patience and understanding as I read quranic words/ayahs slowly and don\'t always pronounce them correctly. I enjoy my classes so much that I schedule my classes 3 months ahead of time. May Allah show his mercy and grant her and the academy the highest level of paradise.', '5', 1, '2020-12-11 16:42:15', '2020-12-11 16:42:15', '2019-07-08 07:00:00'),
(129, 'Sohail Shahid', 'I have a very good experience with them. Trustworthy academy and my great teacher Nady Doaa', '5', 1, '2020-12-11 16:43:06', '2020-12-11 16:43:06', '2019-07-10 07:00:00'),
(130, 'Saqib Habib', 'We are very happy with the service, the teachers are all qualified and very helpful anyone looking for a good learning and wants their kids to learn in a proper way this is the place . I’m with them for the past 2 years and I will continue Insha Allah . Thanks for the hard work .', '5', 1, '2020-12-11 16:44:00', '2020-12-11 16:44:00', '2019-07-21 07:00:00'),
(131, 'Amna Rehan', 'The Online Quran Tution are highly organized and professional mansha Allah. They also have qualified teachers with good credentials. I have been with them for couple years and I love their way of teaching Mansha Allah.', '5', 1, '2020-12-11 16:45:14', '2020-12-11 16:45:14', '2019-07-27 07:00:00'),
(132, 'Fiza Farhana', 'It was a great experience', '5', 1, '2020-12-11 16:46:15', '2020-12-11 16:46:15', '2019-07-29 07:00:00'),
(133, 'Javed', 'My boys have been having lessons for the past 3 months. They already knew some of the basics before they started. They have made significant progress since starting online and have improved their tajweed which was most important to me. My older son is also memorizing surahs and they enjoy learning Duas and hadiths as well. I am very happy with the teacher and they have a good relationship with her.', '5', 1, '2020-12-16 16:30:58', '2020-12-16 16:30:58', '2019-08-03 07:00:00'),
(134, 'Saman Ch', 'My teacher is very nice and understanding. She always makes sure that I understand before moving forward, allowing me to learn at my own pace. The Qur\'an classes have been very helpful in improving my recitation but also my overall engagement with the Qur\'an. I\'m also doing tafsir with my teacher so it\'s nice to not only recite but learn about what I\'m reciting. Alhamdulillah, the experience has been really amazing and I would definitely recommend for anyone who is unable to find a teacher within their local community.', '5', 1, '2020-12-16 16:35:10', '2020-12-16 16:35:10', '2019-08-06 07:00:00'),
(135, 'Ahmed Ali', 'Excellent place to learn how to read quran with tajweed. My teacher is very good, with excellent communications skills and very knowledgable.\r\n\r\nI would definitly recommend to anyone looking to learn how to recite the quran.\r\n\r\nThank you to the team at “Online Quran Tution”.', '5', 1, '2020-12-16 16:37:27', '2020-12-16 16:37:27', '2019-08-10 07:00:00'),
(136, 'Almas', 'Excellent teacher! Very patient and smily.\r\nAdapt to every circonstances', '5', 1, '2020-12-16 16:38:23', '2020-12-16 16:38:23', '2019-08-16 07:00:00'),
(137, 'Muhammad Faisal', 'The teacher is wonderful and the methodology of the program has established consistency and true learning. Great program!', '5', 1, '2020-12-16 16:39:00', '2020-12-16 16:39:00', '2019-08-17 07:00:00'),
(138, 'Fabiya', 'Very happy with the one to one attention given by the teacher to my so with Online Quran Tution.', '5', 1, '2020-12-16 16:39:56', '2020-12-16 16:39:56', '2019-08-19 07:00:00'),
(139, 'Zahid Hussain', 'You. Are really good and have helped my child with recitations', '5', 1, '2020-12-16 16:41:26', '2020-12-16 16:41:26', '2019-08-22 07:00:00'),
(140, 'Rubina Shaikh', 'Excellent customer service and excellent teacher.we are satisfied.', '5', 1, '2020-12-16 16:42:13', '2020-12-16 16:42:13', '2019-08-26 07:00:00'),
(141, 'Abdullahi M Said', 'Very happy with the way the teacher teaching my daughter', '5', 1, '2020-12-16 16:43:31', '2020-12-16 16:43:31', '2019-08-27 07:00:00'),
(142, 'Jamila Choudhury', 'The Quran Course deserves every star from my star. Excellent tuition of the Quran to the young and old.', '5', 1, '2020-12-16 16:44:21', '2020-12-16 16:44:21', '2019-08-29 07:00:00'),
(143, 'Brother Sayed bana', 'So far it is going well hopefully they benefit from those courses and if you have any issues with the children let me know.', '4.5', 1, '2020-12-16 16:45:30', '2020-12-16 16:45:30', '2019-09-01 07:00:00'),
(144, 'Fashad', 'Great job many thanks', '5', 1, '2020-12-16 16:46:11', '2020-12-16 16:46:11', '2019-09-04 07:00:00'),
(145, 'Maliha Fatima', 'Amazing teacher and administration. I am making a ton of progress.\r\nThe whole experience is amazing and makes me learn without feeling overwhelmed or anxious. My teacher, Yomna Amr, is extremely nice and great at teaching. I love her method.', '5', 1, '2020-12-16 16:47:10', '2020-12-16 16:47:10', '2019-09-06 07:00:00'),
(146, 'marwaadel ammar', 'This is a bless from Allah to be a teacher at this amazing organization. Patient and punctual administration, polite students with high average of respecting. Alhamdullila for this reward from Allah. I recommend every Muslim to join the academy to gain knowledge and be closer to Allah.', '5', 1, '2020-12-16 16:48:00', '2020-12-16 16:48:00', '2019-09-10 07:00:00'),
(147, 'Mohmed', 'Excellent Quran and Arabic teachings. Both my Son and Daughter enjoying this for the last few years.', '5', 1, '2020-12-16 16:48:38', '2020-12-16 16:48:38', '2019-09-16 07:00:00'),
(148, 'Quazi Mohammad Harun', 'Best and One to One Eye Contact Video Quran Learning Center (https://www.onlinequrantuition.co.uk/). Before I give my child one Islamic Global-Link Academy, this Organize\'s teacher\'s maximum time came late and Teacher did not come in Video Call, for this reason, I change Islamic Global-Link Academy.', '5', 1, '2020-12-16 16:49:50', '2020-12-16 16:49:50', '2019-09-17 07:00:00'),
(149, 'Farhat', 'Excellent service and very kind and quified teachers , very happy with course my kids love their teacher and they learning very quick also they enjoy the class alot,and I recommend other parents and guidance to join in I\'m sure their children will love n enjoy . Thanks', '5', 1, '2020-12-16 16:50:33', '2020-12-16 16:50:33', '2019-09-19 07:00:00'),
(150, 'Sariyah’s mum', 'I will definitely recommend other parents to join the Online Quran Tution Professional services excellent teachers qualified kind and caring. They got different techniques to teach little kids, friendly teaching yet no compromise on lessons.', '5', 1, '2020-12-16 16:51:48', '2020-12-16 16:51:48', '2019-09-23 07:00:00'),
(151, 'Shiponara Rohman', 'Extremely knowledgeable, patient, and articulate Teacher. The quality of Arabic teaching is exceptional. My son has progressed so quickly from knowing basics to memorizing 15 surahs and learning over 25 Surahs with tajweed. I highly recommend the one to one classes to family and friends.\r\n\r\nThe customer service, to book, amend, and deal with queries is excellent.', '5', 1, '2020-12-16 16:53:14', '2020-12-16 16:53:14', '2019-09-26 07:00:00'),
(152, 'Rina choudhury', 'No words can express, no act of gratitude can relay, no gift can represent what this institution\'s Online Quran Tuition has online done for me and my whole family. Start from the managing team to the teachers is just awesome. Please accept this note as an indicator of my heartfelt appreciation for the outstanding Service you have provided.', '5', 1, '2020-12-16 16:54:38', '2020-12-16 16:54:38', '2019-09-29 07:00:00'),
(153, 'Adnan', 'My kids have been taking classes online with the Online Quran tuition and I can’t be happier. They are learning the Quraan at home inside their comfort zone. This is an awesome system for busy parents who don’t have time to drive their kids back and forth. The teachers are very knowledgeable and teach my kids in a way that makes them love the subject. If you want to invest in your kids to learn Quran or Arabic this is the way to go!', '5', 1, '2020-12-16 16:55:50', '2020-12-16 16:55:50', '2019-10-02 07:00:00'),
(154, 'Henna', 'Excellent service , great teachers\r\nVery flexible and good value', '5', 1, '2020-12-16 16:56:27', '2020-12-16 16:56:27', '2019-10-06 07:00:00'),
(155, 'Umm Abdul Kareem', 'The teachers are professional and, they know how to manage students with learning difficulties. They are native Arabic speakers and have subject specialism.\r\n\r\nAlways on time and willing to reschedule at the last minute, and are understanding towards last-minute cancellations.', '5', 1, '2020-12-16 16:57:14', '2020-12-16 16:57:14', '2019-10-05 07:00:00'),
(156, 'Ramesh', '5 Star teaching with experienced Arabic speaking teacher and the whole set up is professional and gives me confidence.', '4.5', 1, '2020-12-16 16:57:52', '2020-12-16 16:57:52', '2019-10-16 07:00:00'),
(157, 'Yasmin Hussain', 'I am more than happy I have recommended this company because they are very professional and accommodating.\r\n\r\nI have learned so much and look forward to my classes my teacher is amazing mashallah', '5', 1, '2020-12-16 16:58:36', '2020-12-16 16:58:36', '2019-10-17 07:00:00'),
(158, 'Quazi Mohammad Harun', 'Excellent Teaching system for any type of Student, Mashallah... I will be praying for all teachers at The Quran Course Academy(onlinequrantuition.co.uk).', '5', 1, '2020-12-16 16:59:41', '2020-12-16 16:59:41', '2019-10-19 07:00:00'),
(159, 'Waqas', 'excellent place to improve your tajweed, great teachers who are very patient and the internet is very good when having a conference meeting.', '5', 1, '2020-12-16 17:00:17', '2020-12-16 17:02:55', '2019-10-22 07:00:00'),
(160, 'Shida', 'Very reliable tutors.... very happy with my teacher', '5', 1, '2020-12-16 17:00:46', '2020-12-16 17:00:46', '2019-10-24 07:00:00'),
(161, 'UMM AYYOUB LONDON', 'MashaAllah brilliant service. Excellent engaging tutor to my 5 sons. Always on time and dedicated. Very happy with the service would definitely recommend it.', '5', 1, '2020-12-16 17:01:30', '2020-12-16 17:01:30', '2019-10-26 07:00:00'),
(162, 'Aisha Aslam', 'I wish I could give infinite stars!! 5 is not enough! Not only is my teacher a piece of heaven but everybody I have interacted with from this online institute has a wonderful vibe and it makes learning to read and recite the Quran a very magical and spiritual experience. I feel elated every time. My teacher gives a detailed breakdown and structure to the lessons which helps with the complexity of memorizing not only the Quran but the rules of reading arabic correctly and with concise pronunciation. I highly recommend!!', '5', 1, '2020-12-16 17:02:30', '2020-12-16 17:02:30', '2019-10-27 07:00:00'),
(163, 'Abdulah', 'Alhamdullilah so far so good. I am satisfied with their honest and prompt service. The tutor is always on time and knowledgeable in teaching Quran with Tajweed. I highly recommend https://onlinequrantuition.co.uk/', '5', 1, '2020-12-17 14:15:39', '2020-12-17 14:15:39', '2019-11-02 07:00:00'),
(164, 'Ayesha', 'It\'s very difficult to find professional Quran teachers to teach children online. The teacher Masha Allah is extremely polite and punctual. My kids are very comfortable in learning the Quran. Also, they have made very good progress Alhumdulillah!\" I wish I would of known about the online facility years ago!! Highly recommended to anyone who wants their children to progress at their own pace. Sister Asma has been amazing Mashallah and I am so grateful for the way she puts her compassion in teaching my children.', '5', 1, '2020-12-17 14:16:29', '2020-12-17 14:16:29', '2019-11-06 07:00:00'),
(165, 'AB', 'From the very start, we have been made to feel welcomed. Sister Asma has shown she is just as capable of teaching our children online as she would face to face, she is very great with my child and I always feel I have the ability to ask questions or for help from Hassan if needs be. Definitely would recommend it, especially given the current global circumstances. Also, for the price I could never complain, they have gone above and beyond to make sure we are comfortable and that my child is learning at her own pace and understanding what she is learning. She has been taught more in the last month than I had taught her in a few years and that makes me a very happy client. Jazak’Allahu Khairun!', '5', 1, '2020-12-17 14:17:38', '2020-12-17 14:17:38', '2019-11-08 07:00:00'),
(166, 'Iqra Tahseen', 'onlinequrantuition.co.uk is a great initiative for kids to take online Quran classes at the comfort of their home and learn Quran online. Masha Allah, my kids are doing great ever since they started. Their teachers are very kind and respectful.', '5', 1, '2020-12-17 14:18:37', '2020-12-17 14:18:37', '2019-11-03 07:00:00'),
(167, 'UMER RAFI', 'The institute is run by professionals. They have good understanding of Arabic and also teach Quran with translation. Highly recommended.', '5', 1, '2020-12-17 14:19:21', '2020-12-17 14:19:21', '2019-11-16 07:00:00'),
(168, 'Asra Hasan', 'Have been with them for 5 months now and the experience had been great. We got a very good and dedicated tutor who teaches my 7-year-old son. He teaches with a lot of patience and keeps him motivated too. The management is very approachable and helps you out when you need anything.', '5', 1, '2020-12-17 14:20:29', '2020-12-17 14:20:29', '2019-11-19 07:00:00'),
(169, 'Steve', 'I have hired a number of teachers for my children for the purpose of learning the Quran but sooner or later I needed to change them usually due to the issue of timing.\r\nThese guys are absolutely best as well as their timings are very flexible. They are also very good at teaching and teachers to know to make their students learn.', '5', 1, '2020-12-17 14:21:18', '2020-12-17 14:21:18', '2019-11-26 07:00:00'),
(170, 'Waqqas Mohsin', 'The website is quite helpful and helps my family connect with learned imams in reciting the Holy Quran!', '5', 1, '2020-12-17 14:22:12', '2020-12-17 14:22:12', '2019-11-27 07:00:00'),
(171, 'Abdiweli Ali', 'They are patient with you and teach you very well.', '5', 1, '2020-12-17 14:23:02', '2020-12-17 14:23:02', '2019-11-29 07:00:00'),
(172, 'Adil Balti', 'I personally read the Quran with complete Tajweed and I only prefer to read with Tajweed. Due to my busy schedule, unfortunately, I cannot give proper time to teach 3 of my kids. I hire 2 Quran Academies before, but they can not teach in the way I want. They are not following the actual Tajweed.\r\nI found these guys (Online Quran Tuition with Tajweed) they are best in teaching the Quran with Tajweed.\r\nThank You - Highly Recommended - You can trust and hire them.', '5', 1, '2020-12-17 14:24:22', '2020-12-17 14:24:22', '2019-12-07 07:00:00'),
(173, 'Nadia', 'This is a great way for our children to learn the Quran. The tutors are great, very attentive, and punctual. We are extremely happy with this service.', '5', 1, '2020-12-17 14:25:00', '2020-12-17 14:25:00', '2019-12-11 07:00:00'),
(174, 'Anoshia', 'This portal is extremely useful for those who are willing to connect with the Quran but can\'t do it due to their hectic daily routine. The courses are quite extensive and tutors are really helpful.\r\nIndeed, a highly recommended Online Quran Tuition website for all!', '5', 1, '2020-12-17 14:26:05', '2020-12-17 14:26:05', '2019-12-13 07:00:00'),
(175, 'AK', 'Very organized and well run Online Quran Tuition program. Thank you.', '5', 1, '2020-12-17 14:27:21', '2020-12-17 14:27:21', '2019-12-16 07:00:00'),
(176, 'Mustafa', 'My boys have been having lessons for the past 3 months. They already knew some of the basics before they started. They have made significant progress since starting online and have improved their tajweed which was most important to me. My older son is also memorizing surahs and they enjoy learning Duas and hadiths as well. I am very happy with the teacher and they have a good relationship with her.', '5', 1, '2020-12-17 14:27:55', '2020-12-17 14:27:55', '2019-12-19 07:00:00'),
(177, 'Samman Chaudhry', 'My teacher is very nice and understanding. She always makes sure that I understand before moving forward, allowing me to learn at my own pace. The Qur\'an classes have been very helpful in improving my recitation but also my overall engagement with the Qur\'an. I\'m also doing tafsir with my teacher so it\'s nice to not only recite but learn about what I\'m reciting. Alhamdulillah, the experience has been really amazing and I would definitely recommend it for anyone who is unable to find a teacher within their local community.', '5', 1, '2020-12-17 14:30:05', '2020-12-17 14:30:05', '2019-12-26 07:00:00'),
(178, 'Rabia Anum', 'I have registered on many other online courses in the past but this online provider has to be the best. It has amazing and supportive Teachers and Administration Staff.', '5', 1, '2020-12-17 14:30:54', '2020-12-17 14:30:54', '2019-12-27 07:00:00'),
(179, 'STB', 'Probably the best online Quran lessons. Thank you!', '5', 1, '2020-12-17 14:31:45', '2020-12-17 14:31:45', '2019-12-29 07:00:00'),
(180, 'Abdullahi M Said', 'Great Teachers!', '5', 1, '2020-12-17 14:32:30', '2020-12-17 14:32:30', '2020-01-01 07:00:00'),
(181, 'Umm Wafaa', 'Excellent service and amazing Quran teacher. Very effective course and friendly warm teachers.', '5', 1, '2020-12-17 14:33:08', '2020-12-17 14:33:08', '2020-01-06 07:00:00'),
(182, 'Sila', 'My kids used to go to an Islamic school for one year and a couple of months they couldn\'t read the Quran, they just learned Arabic letters. Now, they\'ve been with online quran tuition for two years, and they are able to read from the Quran Kareem and they are moving forward. I appreciate your efforts. I would like to thank Miss Rasha as well.', '5', 1, '2020-12-17 14:34:29', '2020-12-17 14:34:29', '2020-01-09 07:00:00'),
(183, 'Dua', 'My teacher Doaa Nady is great. She is very knowledgeable and patient with me. I really appreciate her.', '5', 1, '2020-12-17 14:34:55', '2020-12-17 14:34:55', '2020-01-16 07:00:00'),
(184, 'Sumaira', 'Extremely pleased with my instructor and the outcomes of our sessions. As I\'m memorizing the Quran, I\'m unpacking different lessons derived from it that allow for a more concrete understanding of it.', '5', 1, '2020-12-17 14:35:29', '2020-12-17 14:35:29', '2020-01-17 07:00:00'),
(185, 'Umme Hina', 'I am really enjoying teaching, especially learning from home. no more excuses.', '4.5', 1, '2020-12-17 14:36:05', '2020-12-17 14:36:05', '2020-01-19 07:00:00');
INSERT INTO `testimonials` (`id`, `name`, `review`, `rating`, `status`, `created_at`, `updated_at`, `review_date`) VALUES
(186, 'Sohail', 'such an amazing supportive classes. Teachers are absolutely providing a child- friendly atmosphere. The kids join the sessions without being pressurized. The teachers are able to fit the sessions according to the kids capacity; thus, for every kid the session is tailored for him/ he', '5', 1, '2020-12-17 14:36:42', '2020-12-17 14:36:42', '2020-01-20 07:00:00'),
(187, 'Amer', 'I worked with Br. Hossam and he was awesome. I am an old guy trying to relearn the Quran and he was very helpful.', '5', 1, '2020-12-17 14:37:27', '2020-12-17 14:37:27', '2020-01-26 07:00:00'),
(188, 'Adam', 'MashaAllah the teachers are well trained and qualified. Alhamdulilah they helped my kids to read and learn the Quran.', '5', 1, '2020-12-17 14:38:03', '2020-12-17 14:38:03', '2020-02-06 07:00:00'),
(189, 'Mustafa', 'Quran Courses online responds quickly and efficiently to address any issues I have with my son’s Quran class and teachers. Teachers are well qualified, are very nice, and are doing a superb job with my son’s training and lessons. Thank you!', '5', 1, '2020-12-17 14:38:47', '2020-12-17 14:38:47', '2020-02-09 07:00:00'),
(190, 'Mona Huda', 'i like it its fun and my teachers are nice', '5', 1, '2020-12-17 14:39:21', '2020-12-17 14:39:21', '2020-02-10 07:00:00'),
(191, 'S.E', 'Truly a great experience. They are very organized and fairly priced. My instructor adapts to my needs and teaches at the pace that best suits me.', '5', 1, '2020-12-17 14:40:01', '2020-12-17 14:40:01', '2020-02-16 07:00:00'),
(192, 'Fatima', 'Easy to communicate with the administer, easy signup process, and getting started with classes is seamless. My tutor is very knowledgeable and I am making progress. I am a working adult and I take my classes before leaving for work.', '5', 1, '2020-12-17 14:40:39', '2020-12-17 14:40:39', '2020-02-18 07:00:00'),
(193, 'Adil', 'It is going well', '5', 1, '2020-12-17 14:42:30', '2020-12-17 14:42:30', '2020-02-20 07:00:00'),
(194, 'Jasmin Amir', 'I absolutely LOVE this online course! My instructor is amazing, she is very good at explaining the material and provides resources for practice and to simplify difficult lessons. Would recommend to anyone even if you are busy with school or work. This is a great website to do a few minutes each week and without realizing it you end up accomplishing a huge milestone', '5', 1, '2020-12-17 14:43:14', '2020-12-17 14:43:14', '2020-02-26 07:00:00'),
(195, 'Ali', 'Best quran class ever... The teachers are really nice and helpful.', '5', 1, '2020-12-17 14:44:01', '2020-12-17 14:44:01', '2020-03-01 07:00:00'),
(196, 'Hanisa Ahmed', 'The customer service was fast to respond help full\r\nJazaKallah Khair', '5', 1, '2020-12-17 14:44:45', '2020-12-17 14:44:45', '2020-03-06 07:00:00'),
(197, 'Tahir Hussain', 'I had a really good experience with my teacher. She always explains everything well and in detail. However, I would like to have a deep learning about rules of Tajweed', '5', 1, '2020-12-17 14:45:24', '2020-12-17 14:45:24', '2020-03-16 07:00:00'),
(198, 'Afsana Jahan', 'The teacher is so good! She handles my son with Patience.', '5', 1, '2020-12-17 14:46:19', '2020-12-17 14:46:19', '2020-03-18 07:00:00'),
(199, 'ayesha siddika', 'the teachers are very kind and teach the students with patience', '5', 1, '2020-12-17 14:47:32', '2020-12-17 14:47:32', '2020-03-26 07:00:00'),
(200, 'Naima Hassan', 'Alhamdulillah, my teacher is very patient, she takes time in explaining things and makes sure everything is being understood.', '5', 1, '2020-12-17 14:48:40', '2020-12-17 14:48:40', '2020-04-06 07:00:00'),
(201, 'Muhammad Faisal', 'It is really a great way to learn how to recite or memorize the Quran. I like the fact that you pick your own time. Jazakelahu khairan', '5', 1, '2020-12-17 14:49:13', '2020-12-17 14:49:13', '2020-04-16 07:00:00'),
(202, 'Adetutu Jimoh', 'I\'ve been using the Quran course for my kids since Mar and my kids have improved a whole lot. I\'ve recommended this program to two of my friends already.', '5', 1, '2020-12-17 14:50:31', '2020-12-17 14:50:31', '2020-04-18 07:00:00'),
(203, 'Sumiya', 'Very good! I am very happy..my teacher is friendly and great...I am really improving\r\nThank you Teacher Rasha Muhammad!', '5', 1, '2020-12-17 14:50:59', '2021-12-06 22:49:53', '2021-08-05 07:00:00'),
(204, 'Touseef Abbasi', 'Excellent Services I am impressed MashaAllah Very Intelligent teachers and friendly Staff and Punctual Management of Online Quran Tuition.\r\nTouseef Abbasi', '5', 1, '2020-12-17 14:52:41', '2021-12-06 22:49:23', '2021-08-17 07:00:00'),
(205, 'Muhammad Faisal', 'Very Professional Tutors.\r\nSaim From USA FL', '5', 1, '2020-12-17 14:53:20', '2021-12-06 22:48:46', '2021-09-08 07:00:00'),
(206, 'Fatimah Yasir', 'Wonderful teaching Services Provided by Online Quran Academy. Alhamdulillah, My Daughter Just Completed Quran Translation Course by Your Institute.', '5', 1, '2020-12-17 14:54:07', '2021-12-06 22:48:18', '2021-10-13 07:00:00'),
(207, 'Ali Mirza', 'My daughters have been reading Qur\'an with the Online Quran Tuition for a few months now and Al-hamdulillah they are doing well. They started with a local teacher but we had to find someone new when that teacher had to move. The teachers are very flexible and patient and are highly recommended', '5', 1, '2020-12-18 03:25:11', '2021-12-06 22:46:48', '2021-11-25 07:00:00'),
(208, 'Shahzad Ahmed', 'Excellent place to improve your tajweed, great teachers who are very patient and the internet is very good when having a conference meeting.', '5', 1, '2021-03-15 17:31:47', '2021-12-06 22:47:42', '2021-12-01 07:00:00');
