(1, 277, 'Support', 'MAKDZNFUVH', 'How to find a teacher', 'high', '<p>Assalamu\'alaikum. Just wanted to find out how i assign the programme that i would like to do and how a teacher is assigned.&nbsp;<br />JazakAllah Khayr&nbsp;</p>', 'closed', '2021-01-02 05:51:52', '2021-01-02 18:32:14'),
(2, 363, 'Support', 'FEB5KYERZO', 'Next steps', 'high', '<p>Asalaamu Alaykum,</p>\r\n<p>I hope you are well.</p>\r\n<p>I recently signed up for a free trial and I received an email saying that my enrollment was successful along with my login but I am not sure what I should do now or when I start.</p>\r\n<p>I would really appreciate some guidance and instructions of what to do next.</p>\r\n<p>Kowser</p>', 'closed', '2021-01-06 05:04:19', '2021-01-07 18:59:35'),
(3, 405, 'Inquiry', 'QBP8FCLJWD', 'Learning Trial', 'medium', '<p>Assalamu alalikum, I recently signed up for a learning trial. It seems like I have been accepted but don\'t have details on how to arrange my first session, please can you let me know how to proceed?</p>', 'closed', '2021-01-07 18:00:16', '2021-04-05 13:51:05'),
(5, 434, 'Inquiry', 'U2IIMLIM0H', 'How to start fir a beginner', 'high', '<p>5 year old I\'ve joined the free trial but dont know how to get started jzk</p>', 'open', '2021-01-08 19:51:46', '2021-01-08 19:51:46'),
