baseline; box-sizing: inherit; color: var(--highlight-keyword);\">function</span>() </span>{\r\n    $(<span class=\"hljs-string\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: var(--highlight-variable);\">\'#thing\'</span>)[<span class=\"hljs-number\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: var(--highlight-namespace);\">0</span>].scrollTop = $(<span class=\"hljs-string\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: var(--highlight-variable);\">\'#thing\'</span>)[<span class=\"hljs-number\" style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; box-sizing: inherit; color: var(--highlight-namespace);\">0</span>].scrollHeight;\r\n})</code></pre>\r\n</div>\r\n</div>', 'open', '2021-01-14 03:19:07', '2021-01-14 03:19:07'),
(7, 826, 'Inquiry', 'AWBATTMBZF', 'Tajweed', 'medium', '<p>Salaam,</p>\r\n<p>&nbsp;</p>\r\n<p>I am looking for a Tajweed class to improve my Qur\'an reciting and pronounciation&nbsp;</p>', 'open', '2021-03-26 20:47:58', '2021-03-26 20:47:58'),
(8, 495, 'Support', 'CCHEQWTCQG', 'Lessons', 'high', '<p>Hi please can you tell me how I can enrol onto the lessons to learn Quran?</p>', 'open', '2021-03-27 19:06:00', '2021-03-27 19:06:00'),
(9, 495, 'Support', 'BRMBQWWBMK', 'Lessons', 'high', '<p>Hi please can you tell me how I can enrol onto the lessons to learn Quran?</p>', 'open', '2021-03-27 19:06:02', '2021-03-27 19:06:02'),
(10, 802, 'Billing', 'O1LHF4OGKN', 'struggling to sign up', 'high', '<p>I have been trying to start my subscription but however it is not working. It keep saying browser isn\'t supported. it does not work on my phone and my laptop</p>', 'open', '2021-04-02 23:01:25', '2021-04-02 23:01:25'),
(11, 504, 'Inquiry', '94VITTHTRJ', 'Quran Teach', 'high', '<p>Asalamu\'alaikum, I am looking for a female quran teacher. Can you please let know if someone is available, who I can have trial lessons with.</p>', 'closed', '2021-04-11 00:07:20', '2021-04-11 00:07:39'),
(12, 504, 'Inquiry', 'ZA2FQX0NOV', 'Quran Teacher', 'high', '<p>Asalamu\'alaikum, I am looking for a female quran teacher. Can you please let know if someone is available, who I can have trial lessons with.</p>', 'open', '2021-04-11 00:07:25', '2021-04-11 00:07:25'),
(13, 1393, 'Inquiry', 'WMPYDLH3CK', 'Question About Teachers', 'medium', '<p>In the Name of Allah, the Beneficent, the Merciful</p>\r\n<p>&nbsp;</p>\r\n<p>Salaamun Alaykum,</p>\r\n<p>Insha\'Allah this will find you well. I am interested in having tajweed lessons, but would like a female Arab teacher. Is this possible.</p>\r\n<p>&nbsp;</p>\r\n<p>Also, I don\'t want to learn from the noorani qaida, as I would like to be able to learn and read the Uthmani script.</p>\r\n<p>&nbsp;</p>\r\n<p>Please advise.</p>\r\n<p>&nbsp;</p>\r\n<p>Fi amanillah</p>\r\n<p>Farah</p>', 'closed', '2021-04-28 21:06:32', '2021-04-29 01:17:32'),
(14, 1381, 'Inquiry', 'QZDWMYFKDJ', 'Further information', 'high', '<p>Aslamualikum,</p>\r\n<p>Can you please advise me how the process works. I texted on the WhatsApp number but did not get any reply.&nbsp;<br /><br /></p>\r\n<p>jazkaallah.&nbsp;</p>', 'open', '2021-04-29 04:45:05', '2021-04-29 04:45:05'),
(15, 1381, 'Inquiry', 'LLXL9YIUZ5', 'Further information', 'high', '<p>Aslamualikum,</p>\r\n<p>Can you please advise me how the process works. I texted on the WhatsApp number but did not get any reply.&nbsp;<br /><br /></p>\r\n<p>jazkaallah.&nbsp;</p>', 'open', '2021-04-29 04:45:06', '2021-04-29 04:45:06'),
