(19, 2391, 'Inquiry', 'N1GVV9EAFJ', 'Free trial', 'high', '<p>Assalamu alaikum,</p>\r\n<p>I register for a free trial for my children but your states no tutor has been assigned, will I be able to arrange a trial session for my children aged 5, 7 and 9?</p>\r\n<p>&nbsp;</p>\r\n<p>Jzk</p>', 'closed', '2021-07-07 23:34:05', '2021-07-07 23:34:38'),
