(23, 2696, 'Inquiry', 'CIOTISKQZO', 'Trial', 'high', '<p>Salaam, I made an inquiry a few days ago but I haven\'t yet been assigned anyone to speak to to discuss how the classes would work.&nbsp;<br /><br /></p>\r\n<p>Please could someone get back to me.&nbsp;<br />Jazakallah Khair&nbsp;</p>\r\n<p>Lina</p>', 'open', '2021-08-05 03:53:51', '2021-08-05 03:53:51'),
(24, 2920, 'Inquiry', 'GK28DJ4Q7P', 'Start date', 'high', '<p>When and how can I start my first lesson?&nbsp;</p>', 'open', '2021-08-29 08:37:13', '2021-08-29 08:37:13'),
(25, 3164, 'Inquiry', 'WULLDPOFRK', 'Classes', 'medium', '<p>Hi there,</p>\r\n<p>I recently signed up for the 3 trial online Quran lessons and I\'m wondering when I\'m supposed to do them. How do I start them?</p>\r\n<p>Thank you.&nbsp;</p>', 'closed', '2021-09-02 14:47:25', '2021-09-05 17:13:41'),
