(27, 3432, 'Inquiry', '9OMYJOCLLM', 'Password', 'high', '<p>Hi I am having trouble changing my old password to new one&nbsp;</p>', 'open', '2021-09-15 02:32:54', '2021-09-15 02:32:54'),
