(29, 3581, 'Support', '6NGS0WFQ6L', '3 Day Trail Registration', 'high', '<p>Hi,</p>\r\n<p>I signed up for a 3 day trial 2 days ago, but i still havent been assigned a quran tutor.</p>\r\n<p>Can you please look into this as a matter of urgency and let me know a timeline on when i can expect to see this on the dashboard?&nbsp;</p>\r\n<p>Jzk</p>', 'open', '2021-09-25 00:45:48', '2021-09-25 00:45:48'),
(30, 3598, 'Inquiry', 'O4JKZ3EMRI', 'Inquiry 14 hours ago', 'high', '<p>Assalamualaykum warahmatullahi wabarakkatu, I\'m unsure what is your procedure I\'ve registered and have access to nothing but a dashboard with pending inquiries. With whom do I speak, communicate and retrieve information from in this 3 day trial period? What exactly am I trialling Inshaa allah ?&nbsp;<br /><br /><br /></p>\r\n<p>I would really appreciate a response&nbsp;</p>\r\n<p>Jazak Allah khayr</p>', 'open', '2021-09-25 18:26:18', '2021-09-25 18:26:18'),
(31, 3616, 'Inquiry', 'CVEK0OMMJI', 'Inquiry problem', 'medium', '<p>اَلسَّلَامُ عَلَيْكُم&nbsp;&nbsp;</p>\r\n<p style=\"text-align: left;\">I signed up a few days ago, but yet to recieve any information. I wanted to undergo the 3 day free trial prior to paid subscription.</p>', 'open', '2021-09-29 17:29:59', '2021-09-29 17:29:59'),
(32, 94, 'Inquiry', '1UHL9NLCWV', 'Cancelation', 'high', '<p>Assalamu Alaikum Wa Rahmatullahi Wa Barakatuh&nbsp;<br /><br /></p>\r\n<p>I would like to cancel my daughter\'s tuition as from this Tuesday the 5th of October 2021.</p>\r\n<p>I would like this Monday the 4th of October to be the last lesson.&nbsp;<br />I have previously called and left a message but had no reply back.</p>\r\n<p>The teacher was lovely but Zara is going to have a face to face teacher from this coming week In Sha Allah.</p>\r\n<p>JazakAllah Khair for all the help and support given to my daughter Zara during her stay with you.</p>\r\n<p>Salam</p>\r\n<p>&nbsp;</p>', 'open', '2021-10-03 23:54:11', '2021-10-03 23:54:11'),
(33, 4140, 'Inquiry', 'XGXRPUEPBI', 'Quran lesson for 11 year old daughter', 'high', '<p>I would like to enrol my daughter Layla Sajid for Quran lessons - half an hour per week. Please let me know of time availability and charge. Many thanks&nbsp;</p>', 'open', '2021-10-30 05:46:05', '2021-10-30 05:46:05'),
(34, 4042, 'Inquiry', 'VNVPVKW9O7', 'Free trial lessons', 'medium', '<p>Hi I\'ve been waiting for the free trial lesson for a few days now. Please can you let me know what\'s happening so I can make other arrangements if need be.</p>', 'open', '2021-10-31 23:38:30', '2021-10-31 23:38:30'),
(35, 4916, 'Support', 'BIDGFWOOTZ', 'How to book', 'medium', '<p>How do you book on to a course</p>', 'open', '2021-11-20 02:47:26', '2021-11-20 02:47:26'),
(36, 5010, 'Inquiry', '7AFGN6AFBL', 'Free trial classes', 'medium', '<p>Salaam&nbsp;</p>\r\n<p>I have three children 15,14 &amp;11 year old. I would like them to learn how to read the quran.&nbsp;<br />can someone please contact me to discuss the free trial lessons ? My phone wasn\'t working yesterday but it is fixed today. My number is 07840344144 my name is Sadia&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>thanks&nbsp;</p>', 'open', '2021-11-23 16:13:01', '2021-11-23 16:13:01'),
(37, 3578, 'Billing', 'XVMGTIBMGU', 'how to set up monthly subscription', 'medium', '<p>Good Evening,</p>\r\n<p>Could you pls tell me how to set up the subscription on this online platform you inform me to cancel my Direct Debit and create a new one in this system?</p>\r\n<p>&nbsp;</p>\r\n<p>Regards</p>\r\n<p>Dahir</p>', 'open', '2021-11-27 00:58:38', '2021-11-27 00:58:38'),
(38, 5406, 'Billing', 'MIUNVCSBU5', 'How to pay', 'high', '<p>Asslamu alaikum. I wanted to ask how to add bank details to the website to pay for classes.</p>', 'open', '2021-12-06 02:09:02', '2021-12-06 02:09:02'),
(39, 5537, 'Inquiry', 'FE6B2I7GAN', 'Trial', 'high', '<p>Asalamualaikum,</p>\r\n<p>&nbsp;</p>\r\n<p>I am intrested in having one to one tajweed classes with an english speaking teacher online however I have not been aligned a tutor yet. I was wondering how do I start the trial?</p>\r\n<p>&nbsp;</p>\r\n<p>Kind regards,</p>\r\n<p>&nbsp;</p>\r\n<p>Sana Naeem</p>', 'open', '2021-12-12 18:20:05', '2021-12-12 18:20:05'),
(40, 5662, 'Inquiry', 'MJVZSEOCZ9', 'Online lessons for 4 year old son', 'medium', '<p>Do you offer support for 4 year old boy - I would like him to learn the Quran&nbsp;</p>', 'open', '2021-12-18 01:24:09', '2021-12-18 01:24:09'),
(41, 5704, 'Support', '6C3J1UK9SZ', 'Joining enquiry', 'medium', '<p>Salam</p>\r\n<p>I have 2 boys that I would like to register for quran tuition. How do I add both of them on one account?&nbsp;</p>\r\n<p>They are 12 and 13, they have completed the quran once and are reading it for the second time. They have memorised between 10-15 surahs and they can pray salat.&nbsp;</p>\r\n<p>I would like them to continue with this along with some islamic studies(learn more about islam)&nbsp;</p>\r\n<p>Ideally a male teacher please.&nbsp;</p>\r\n<p>Thanks</p>', 'open', '2021-12-21 06:04:37', '2021-12-21 06:04:37'),
(42, 5646, 'Support', 'F2OAZEQZJZ', 'Free trial lessons', 'medium', '<p>Salaam, I enrolled to have the free trial lessons last week and although I got an email back with details to access the portal I\'m not sure what needs to be done next...</p>', 'open', '2021-12-21 18:34:07', '2021-12-21 18:34:07'),
(43, 5090, 'Billing', 'C2PDXPZVIJ', 'Charged Twice', 'high', '<p>My son Omar Haq has been a student of your online classes for a few months now. This month for some reason I have been charged twice and two lots of &pound;40 has been taken from my account. I have tried to login from my registered account but your system does not recognise my account and will not allow me to change the password or anything so I have had to register with another email. Please refund my payment or I will be cancelling my direct debit as there are plenty other companies offering the same service.</p>', 'open', '2021-12-30 05:59:50', '2021-12-30 05:59:50'),
(44, 3610, 'Support', 'QQH77BKMMI', 'change plan', 'high', '<p>Salaam alaikum, I would like to change my plan to two class per week. Jazakallahu khairan</p>', 'open', '2022-01-01 16:37:43', '2022-01-01 16:37:43'),
(45, 5942, 'Inquiry', 'AGV9FI5SNE', '2 children 3 days a week', 'high', '<p>Asalamualaikum,&nbsp; I have opened the profile for my son Armaan Ahmed he reads 3 days a week Monday, Tuesday,&nbsp; Wednesday 7-7.30pm&nbsp;</p>\r\n<p>My daughter Tayeeba reads same days 7.30-8pm please can you adjust the direct debit discount on the account.&nbsp;&nbsp;</p>', 'open', '2022-01-05 09:09:19', '2022-01-05 09:09:19'),
(46, 5962, 'Inquiry', 'WPJWYE9SIZ', 'Memorizing Quran trial', 'medium', '<p>Asalam 3aleykoum,</p>\r\n<p>I would like to try a Quran memorization course. Just to make sure, it is a one by one course that you offer? The course will be held by a sister as I am a woman, right? <br />If the trial works, I would like to take the 5 lessons/week formula inchAllah.<br />Thanks for your feed-back.</p>\r\n<p>Leyla&nbsp;</p>', 'open', '2022-01-06 04:35:53', '2022-01-06 04:35:53'),
(47, 5928, 'Billing', 'HKLNXH7A14', 'I want to change my plan to 3 days a week', 'high', '<p>Please can you a change &nbsp;my plan to 3 days a week. I have just set up direct debit for 4 days a week, but female teachers are only available 3 days a week. &amp; I cannot do weekends. I want to cancel the 4 days a weeek &amp; take out 3 days a week</p>', 'open', '2022-01-13 00:56:21', '2022-01-13 00:56:21'),
(48, 5903, 'Support', 'GBBKOB2FGZ', 'Query', 'high', '<p>Salam,&nbsp;</p>\r\n<p>I left a query some time ago, but I have not heard back. Can you confirm how/when we can acess the lesson for my son Adam?</p>\r\n<p>thank you.</p>\r\n<p>shahbana&nbsp;</p>', 'open', '2022-01-14 04:36:18', '2022-01-14 04:36:18'),
(49, 6242, 'Inquiry', 'KD16I1K9IL', 'Lessons', 'high', '<div id=\"m#msg-f:1722409573453546726\" class=\"mail-message expanded\" style=\"font-family: sans-serif; font-size: 12.8px;\">\r\n<div class=\"mail-message-content collapsible zoom-normal mail-show-images msg-5180804941408486967\" style=\"overflow-wrap: break-word; width: 328px; margin: 16px 0px; user-select: auto;\">\r\n<div class=\"clear\" style=\"font-family: Roboto, \'Helvetica Neue\', Helvetica, Arial, sans-serif;\">\r\n<div dir=\"ltr\">\r\n<div>Assalamu\'alaykum,</div>\r\n<div>&nbsp;</div>\r\n<div>I am hoping you can help me. I would like lessons for both my wife and my mother.&nbsp;</div>\r\n<div>&nbsp;</div>\r\nFor my mother: Basic Qur\'an recitation (Monday and Friday 2pm - 2:30pm)<br />For my wife: Qur\'an hifdh (Monday &amp; Thursday 1:30pm - 2pm)\r\n<div>&nbsp;</div>\r\n<div>I saw the price online of&nbsp;&pound;35 price per month for 4 lessons a week so I hope this is ok.<br />\r\n<div>&nbsp;</div>\r\n<div>I am planning to join my daughter too but we are still working on what days and time suits her best.</div>\r\n<div>&nbsp;</div>\r\n<div>Can you please tell me if this is something you can help with?</div>\r\n<div>&nbsp;</div>\r\n<div>JazaakAllahu khair,</div>\r\n<div>Billal</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"mail-message-footer spacer collapsible\" style=\"height: 0px;\">&nbsp;</div>\r\n</div>', 'open', '2022-01-20 01:52:02', '2022-01-20 01:52:02'),
(50, 6244, 'Inquiry', 'KCH7FIY75M', 'Price', 'high', '<p>Assalam o Alaikum&nbsp;</p>\r\n<p>I have 3 children age 13 years old boy ,12 years old girl and 10 years old boy Alhamdulillah&nbsp;</p>\r\n<p>They all are reading online and doing good ,but now I want to change their time which teacher can\'t change .I want them to read at 4.30 ,do you have time availability?</p>\r\n<p>Also I am paying &pound;60 month for all 3 children. They are reading 5 days a week . But your price is too much .</p>\r\n<p>Can you give me good price and the time I want .</p>\r\n<p>Thank you&nbsp;</p>', 'open', '2022-01-20 03:20:33', '2022-01-20 03:20:33'),
(51, 6259, 'Inquiry', 'XT7PCVCNPF', 'when is my classes starting', 'high', '<p>hi&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>can i know the timing of the quraan classes please. i have paid today and would like to know the timing.</p>\r\n<p>&nbsp;</p>\r\n<p>thank you.</p>', 'open', '2022-01-21 00:30:55', '2022-01-21 00:30:55'),
(52, 6194, 'Support', 'FJQ7YRQXI9', 'Delete profile', 'medium', '<p>السلام عليكم ورحمة الله وبركاته</p>\r\n<p>I won\'t be continuing with Online Qur\'an Tuition. Please can you delete my profile.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>جزاك الله خيرا</p>\r\n<p>&nbsp;</p>', 'open', '2022-01-27 00:06:34', '2022-01-27 00:06:34'),
(53, 6350, 'Inquiry', 'WEPM8POLOH', 'New Account - How to Get Started?', 'low', '<p>Hi,</p>\r\n<p>I set up this account last week and have had no contact since regarding the trial period or how to proceed. Can someone get back to me please?</p>\r\n<p>Thank you</p>\r\n<p>Saqib Farooq</p>', 'open', '2022-02-01 01:24:21', '2022-02-01 01:24:21');
